import { BrowserRouter as Router, Route } from 'react-router-dom'

class App extends React.Component{

	constructor( ...args){
		super(...args);
	}

	getInitialState() {
		return {
			route: window.location.hash.substr(1)
		}
	}
	render(){
		return (
			 <Router>
			 	<div >
				<Head />
				 <Switch>
<Route path="/about">
<About />
</Route>
<Route path="/users">
<Users />
</Route>
<Route path="/">
<Home />
</Route>
</Switch>
</div>
</Router>
		);
	}

}

export default App;
